Oliver Queen is a wealthy thrillseeker, but through the whims of fate he ends up as something much more - Green Arrow, an archer extraordinaire with a socially conscious and progressive heart and mind. This torrent collects four of the best miniseries from the Emerald Archer's long and storied history:

-Green Arrow 01-04 (1983 Self-Titled Mini)
-Green Arrow - The Longbow Archers 01-03 (1987)
-Green Arrow - The Wonder Year 01-04 (1993)
-Green Arrow: Year One 01-06 (2007)

All are presented in Digital format courtesy of various Empire scanner groups. The self-titled mini is simply by Empire proper, Longbow Archers is by G85+Nahga, The Wonder Year is by Son of Ultron and Year One is from Zone. Thanks to all of those guys and gals for their hard work; please seed, and enjoy! :-)
